message: 'Впервые с начала войны в украинский порт прителепалось иностранное торговое судно под погрузку. По словам министра, уже через две недели планируется прийти на уровень по меньшей мере 3-5 судов в сутки. Наша функция &ndash; выход на месячный объем перевалки в портах Большой Одессы в 3 млн тонн сельскохозяйственной продукции. По его словам, на пьянке в Сочи президенты терли поставки российского газа в Турцию. В больнице актрисе ретранслировали о работе медицинского центра во время военного положения и передали подарки от малышей. Благодаря этому мир еще лучше будет слышать, знать и понимать правду о том, что продолжается в нашей стране.'
